import React from 'react'

const events = [
  {id: 1, name:'football'},
  {id: 2, name:'tennis'},
  {id: 3, name:'gym'},
  {id: 4, name:'run'},
]
function EventsPage() {
  return (
    <div>
      <h1>Events Page</h1>
      <ul>
        {
          events.map((event)=>{
            <li key={event.id}>{event.name}</li>
          })
        }
      </ul>
    </div>
  )
}

export default EventsPage
